pragma solidity ^0.4.18;


contract MultipleOwners {
    struct Owner {
        bool isOwner;
        uint256 index;
    }
    mapping(address => Owner) public owners;
    address[] public ownersLUT;

    event OwnerAdded(address indexed ownerAddress, address indexed addedBy);
    event OwnerRemoved(address indexed ownerAddress, address indexed removedBy);

    function MultipleOwners() public {
        owners[msg.sender] = Owner(true, ownersLUT.length);
        ownersLUT.push(msg.sender);
        OwnerAdded(msg.sender, msg.sender);
    }

    modifier onlyOwner() {
        require(owners[msg.sender].isOwner);
        _;
    }

    function defaultOwner() public view returns (address) {
        require(ownersLUT.length > 0);
        return ownersLUT[0];
    }

    function addOwner(address newOwner) public onlyOwner {
        owners[newOwner] = Owner(true, ownersLUT.length);
        ownersLUT.push(newOwner);
        OwnerAdded(newOwner, msg.sender);
    }

    function removeOwner(address _owner) public onlyOwner {
        // make sure there is at least 1 owner left before removal
        require(ownersLUT.length > 1);

        uint256 index = owners[_owner].index;
        // order does not matter so move last element to the deleted index
        ownersLUT[index] = ownersLUT[ownersLUT.length - 1];
        owners[ownersLUT[index]].index = index;
        // remove last element
        ownersLUT.length--;
        // remove Owner from mapping
        delete owners[_owner];
        OwnerRemoved(_owner, msg.sender);
    }
}
